import "./OneText.css";

const OneText = () => {
  return (
    <div className="one-text">
      <h1 className="one-text-h1">Legal Documents, Simplified</h1>
      <p className="one-text-p">
        Recieve bold, clear, mistake-free legal terminology with
        Access-For-All's new Google Chrome extension.
      </p>
      <button className="extension-button">Download Extension</button>
    </div>
  );
};

export default OneText;
